import './App.css';

class App extends Component {
  render() {
    return (
      <div class="container">

    <div class="jumbotron text-center">
        <h1><span class="fa fa-lock"></span> Admin login</h1>

        <p>Login or Register with:</p>

        <Router href="/login" class="btn btn-default"><span class="fa fa-user"></span>  Login</Router>
        <Router href="/signup" class="btn btn-default"><span class="fa fa-user"></span>  Signup</Router>

    </div>



</div>
    );
  }
}

export default App;
